import React from "react";
import star from "../images/star.png";

function Stars({ numStars }) {
  return (
    <div
      style={{
        display: "flex",
      }}
    >
      <img src={star}></img>
      <img src={star}></img>
      <img src={star}></img>
      <img src={star}></img>
      <img src={star}></img>
    </div>
  );
}

export default Stars;
